import React from "react";
import thumbnail from '../Assetss/smile.png';
import avatar from '../Assetss/astro.png';

const Homepage = () => {
  return (
    <div>
       <div className="header">
                <img src= {thumbnail} className="thumbnail"/>
            <div>
                <p>Good Morning</p>
                <strong className='fellas'>Fellas</strong>
            </div>
        <div className="background-1">
            <h1>Weekend From Home</h1>
            <p>Stay active with little workout</p>
            <img src= {astro} className="avatar-1" />

        </div>
      </div>
    </div>

  );
};

export default Homepage;
